import { useState } from "react";
import "./Welcome.scss";

const Welcome = () => {
  const [startGame, setStartGame] = useState(false);
  return (
    <div className="welcome">
      <h1>SIMON</h1>
      <button
        className="button"
        onClick={() => setStartGame((prevState) => !prevState)}
      >
        Play
      </button>
    </div>
  );
};
export default Welcome;
